import React from "react";

function ListRendering() {
    const names = ['Ann','Bob', 'Julie']
    const nameList = names.map(name => <h2 key={name}>{name}</h2>)
    return (
        <div>
            {nameList}
        </div>
    )
}
export default ListRendering
